(145, 'Mr.Sainath Radhakrishnan ', 'sunil.prabhu@in.abnamro.com', '022-66647904 or  or 022-66647000', 'ABN AMRO Central Enterprise Services Pvt Ltd', 'ABN AMRO Central Enterprise Services Pvt Ltd-Empire Complex- 414-  Senapati Bapat Marg- Lower Parel-Mumbai-Maharashtra-400013', 205, 38, '', '06/01/18', 'ABN AMRO Bank (India) has an eight decade long experience of the Indian business scenario. Traditionally known as a strong \"diamond financing bank\", it has turned into a bank providing a comprehensive range of services with a difference. ABN AMRO (India) has branches in Bangalore, Baroda, Chennai, Delhi, Gurgaon, Hyderabad, Kolkata, Lucknow, Mangalore, Moradabad, Mumbai, Noida, Panipat, Pune, Surat and Tirupur with each branch servicing multi-product relationships. Consumer Banking offers a suite of products for your personal financial needs offered through various channels including ATMs, Doorstep Banking and NetBanking. ABN AMRO Bank in India enjoys a strong image as a corporate bank with comprehensive Global Transaction Services.Its investment banking services are delivered through ABN AMRO (India) Corporate Finance and the Global Financial Market Teams which strive to maintain the permanent position we have built in the marketplace. ABN AMRO Bank has launched its Private Banking Services in India offering a comprehensive range of high quality Portfolio Advisory Services along with a comprehensive transaction execution platform, complemented by personalised Banking and custodial services. ABN AMRO Bank has also launched its microfinance program in India. The program is aimed at delivering credit to the poor women of India, especially in the rural areas, through Microfinance Institutions (MFIs).', '', '', 38, 0, '2012-05-18 09:08:00'),
