(744, 'V.Khanna', 'info@atplonline.net', '124 4288186 or 9810158646 or 124 4288189', 'AppPoint Software Solutions Pvt Ltd', 'AppPoint Software Solutions Pvt Ltd No. 28  BHCS Layout   Bannerghata Road Bangalore Karnataka 560076', 205, 38, '', '06/01/18', 'Applied Software has a successful track record of over a decade providing solutions based on leading edge technologies to the customers in India and the US. In the last three years, it has successfully converted its strong knowledge base in the financial services domain into intellectual property and moved into ready products and solutions markets. Its range of offerings include ready products and solutions for the international financial markets and customized solutions and services covering custom software development, migrations, and managed operations. The company\'s flagship product, WealthSpectrum, is a state of the art modular wealth management platform with integrated CRM designed with focus on the emerging industry trends and business requirements for banks  private banking , asset management companies, broker/dealers, investment advisors and separately managed account  SMA  providers. WealthSpectrum covers portfolio transaction processing with detailed cost basis accounting, performance reporting consistent with AIMR Global Investment Performance Standards  GIPS , tools for actionable tax management, portfolio customization tools including powerful model based management, trade order management, automated account monitoring and alerts, opportunity management and relationship management with collaboration and personalization capabilities and international standards client reporting. It is a browser based application, easy to manage with the convenience of anytime, anywhere access and has been successfully implemented by Indias top financial institutions and asset management companies. It will be launched in the US shortly. The component based modular J2EE architecture of WealthSpectrum provides flexibility to build customized products and solutions or to integrate with existing infrastructure. WealthSpectrum can be provided white labeled for seamless integration into other platforms. Applied Software is open to partnerships and alliances with product vendor', '', '', 38, 0, '2029-12-19 09:08:00'),
