(1291, 'B.Dey', 'bentron.kolkata@gmail.com', '24786430 or 9433012120 9433092220 or 24781663', 'Bergen Systems Pvt Ltd', 'Bergen Systems Pvt Ltd 690 691 Phase V Udyog Vihar Gurgaon Haryana 122016', 205, 38, '', '06/01/18', 'Bentley offers focused solutions to create, manage and publish engineering content critical to the design, construction, operation and maintenance of infrastructure assets around the world. Founded in 1984, Bentley Systems, Incorporated is a premier technology provider dedicated to improving the process of creating and operating permanent assets such as buildings, roadways, manufacturing facilities, and utility and telecommunications networks. The professionals who benefit from Bentley technology include architects, engineers, constructors and owner/operators. Bentley\'s MicroStation, ProjectBank and Viecon software and related services make Bentley the leading technology supplier in the A/E/C/O  architecture, engineering, construction and operations  market. Headquartered in Exton, Pennsylvania, USA, Bentley has offices around the world, including Europe, Australia and Asia. Bentley\'s reach spans the globe, serving more than 300,000 professionals and over 20,000 companies and organizations. It is the largest privately held company in the 2001 Softletter 100. More than 200,000 Bentley users participate in the Bentley SELECT technology and service subscription program. Bentley Systems has been operating in India since late 1996 through a liaison office, recently a 100% subsidiary has been established to cater to the growing market. Bentley India is headquartered in Delhi and has branch offices in Mumbai and Chennai. Bentley Systems has progressed rapidly in the Infrastructure software market place space in India. From being a packaged low value software provider, Bentley India has now transitioned to being a software solution provider for complex infrastructure projects in the area of Plant & Building Design, GIS & Engineering Information Management.', '', '', 38, 0, '2028-06-21 09:08:00'),
