INSERT INTO `tbl_leads` (`leadid`, `leadname`, `emailid`, `contactno`, `company`, `Address`, `stage`, `allocto`, `products`, `nmd`, `notes`, `refname`, `refnumber`, `userid`, `status`, `date_gen`) VALUES
(1690, 'Champalal J. Jain', 'vimal@champaksteel.com', '23862382   23857100 or  or 23800975', 'Champak Steel And Engineering Co.', 'Champak Steel And Engineering Co. 390 392 Gr.Flr. Shankar Mension Near NH Hosp. Girgaum Mumbai Maharashtra 400004', 205, 38, '', '05/01/18', 'For more than 26 years, under the consistent leadership of our three founders, Cerner has focused on developing healthcare information technology  HIT  solutions. Our 870 clinicians, 1,360 engineers and 2,100 consultants have deployed more than 4,300 Cerner Millennium  applications to clients across the globe. Cerner Millennium is a first of its kind, person centric architecture. Now in its 12th release, it is a unified, industrial strength technology platform that delivers ongoing value for organizations ranging from the several doctor physician practice to entire countries. Open and scalable, Cerner Millennium enables core clinical and financial automation while laying an integrated foundation for future growth into venues, services and health communities. It is one of the reasons that Cerner Millennium won top honors in the hospital category at Toward an Electronic Patient Record  TEPR  in 2004 and again in 2005.', '', '', 38, 0, '2013-07-22 09:08:00'),
(1692, 'Shyam Sunder Jhawar', 'clsljanpriya@gmail.com', '32561200 or  or 22680618', 'Champion Ceramics P.Ltd', 'Champion Ceramics P.Ltd Industrial Area  Korba Road Champa Chhattisgarh 495671', 205, 38, '', '05-01-2018', 'Background checks have become an essential component of the business process to mitigate risk in virtually every industry. Until a few years ago, organizations have relied mostly on the information provided by the applicants and face to face interviews. It has become necessary for organizations to receive unbiased information or an opinion from an external professional organization. HR managers spend a lot of their valuable time dealing with the repercussions of newly hired employees who were not successful in the workplace. Finance managers spend a considerable amount of time analyzing a lender. Security officers often prefer to know the criminal history of their future employees and service vendors. Public servants wish to have a process to analyze motor vehicles. cFIRSTs cutting edge technological system, cfConnect, together with our professional researchers, provides up to date information to our clients. A comprehensive profile report, known as the cfReport, is generated and sent to our clients for researched cases. Utilizing constant updates from educational institutions, employers, payroll systems, public safety departments, and other related entities, we provide information that is as accurate as possible to make your next step a sure step in the right direction.', '', '', 38, 0, '2022-07-15 09:08:00'),
(1693, 'S.Agarwal', 'champion@championceramics.com', '245693 or 94252231 or 245761', 'Champion Engineering Works', 'Champion Engineering Works A37 1 Mayapuri Indl. Area Delhi Delhi 110064', 205, 38, '', '05-01-2018', 'CGI India was established in 1990 with global development centers in Bangalore and Mumbai, both certified SEI CMM Level 5 and ISO 9001:2000. CGI is a pioneer of the offshore software industry in India and is managed by a team of professionals, each having an average of over 20 years of experience in the software industry in India and abroad. CGI India provides a full range of IT services including, consulting, system integration and management of business and IT functions. It delivers high quality, fixed price, fixed time frame solutions through proprietary tool enabled service and total software quality management  TSQM  process. CGI India is wholly owned subsidiary of CGI Global Corp, Canada, which has software development centers at Boston, New York, Houston and Cleveland in the US and Montreal, Toronto and Quebec City in Canada, London  UK  and Paris  France . CGI targets niche markets where it has developed specialized expertise financial services and telecommunications, plus manufacturing to retail value chain, government, including the healthcare sector, as well as public utilities and services.', '', '', 38, 0, '2022-07-16 09:08:00'),
