(1808, 'P.T. Shahani', 'prakash_shahani@yahoo.com', '26442406 or  or 26442406', 'Classic Electrodes I  Ltd.', 'Classic Electrodes I  Ltd. 1A Boneield Lane Kolkata West Bengal 700001', 205, 38, '', '06-01-2018', 'In an era of rapidly changing technology, the Indian arm of CI Global Technologies LLC, which is, CI.COM  P  LTD.  CI was established in 1996. What started as an education point soon flourished into full fledged Offshore Software Development Center by virtue of strict adherence to quality and delivery of services of excellence. CI is accredited as  Software Technology Park by the Government of India. Strict adherence to quality coupled with good processes has paid with the much acclaimed ISO 9001:2000 certification. CI has been certified for BS 7799 Information Security Management Systems by DNV. BS 7799 is a globally accepted standard that provides comprehensive control guidelines representing the best practices in Information Security Management. CI joins one among the handful of companies that are awarded BS 15000 Information Security Management Systems by DNV. BS 15000 is a British Standard specification that includes the best practices for Information Technology Service Management  ITSM . It provides a globally recognized and proven framework for high quality IT service delivery. CI is has entered range of products in its portfolio that has wide acceptances over the globe. Presently CI is having over 75 prestigious customers allover the world. CI is the recipient of the following awards: Best Woman Entrepreneur of the Country 2004 received from President of India awarded by Industry Dept. of Government of India  Export Excellence Sectoral Award  SSI  Project Services including On Site Services  2002 2003 from Export Promotion Council of India  ESC   Rajiv Gandhi National Quality Award  2003 from Bureau of Indian Standards Udyog Rattan Award for Excellence in Productivity, Quality, Innovation & Management  2003 from Institute of Economic Studies  IES   National Award for Small Scale Entrepreneur  2003 received from Vice President of India, awarded by Government of India  National Award for Consistent Growth  200', '', '', 38, 0, '2022-11-08 09:08:00'),
(1809, 'Hanuman Prasad Agarwal', 'classicelectrodes@vsnl.net', '22429581 or 9331015204 or 22426081', 'Classic Finishers India P. Ltd.', 'Classic Finishers India P. Ltd. E 107 Sector 7 Noida Uttar Pradesh ', 205, 38, '', '06-01-2018', 'CIANT Technologies Pvt Ltd in India, an affilaite of CIANT Corporation of USA, has over the past few years introduced a series of initiatives in India market, especially in Data Quality and its relevance to domestic and global businesses, data warehousing, and solutions for compliance with laws on anti money laundering and homeland security, and best practices in Customer Relationship Management  CRM , Customer Data Integration  CDI  and Fraud Management. It has patent pending technologies in state of the art Data Quality tools and highly accurate Data Matching engines already in operation in USA, Mexico, Brazil, Australia, and most recently, in India. The company plans to introduce their products in 3 additional markets: Chile, Russia and Singapore, where currently market pilots are in progress. It has patent pending technologies in state of the art Data Quality tools and highly accurate Data Matching engines already in operation in USA, Mexico, Brazil, and most recently, in India. The company plans to introduce their products in 4 additional markets: Australia, Chile, Russia and Singapore, where currently market pilots are in progress.', '', '', 38, 0, '2022-11-09 09:08:00'),
