or Microsoft and standard Implementation partner for Oracle. 2005 was a very special year for Comat when we were identified as one of the Top 100 private companies in Asia by Red Herring. We were chosen for our excellent business model and our ability', '', '', 38, 0, '2023-01-07 09:08:00'),
