n advanced capabilities. These include systems design and integration; IT and business process outsourcing; applications software development; Web and application hosting; and management consulting. Headquartered in El Segundo, Calif., CSC reported revenue of $14.6 billion for the 12 months ended Sept. 29, 2006. For more information, visit the company\'s Web site at www.csc.com.', '', '', 38, 0, '2023-01-23 09:08:00'),
