(1921, 'Er Kompal Bansal', 'consultants.corporate@gmail.com', '0172 2692461 or  or 0172 2692461', 'Corporate Executive Board India Pvt Ltd', 'Corporate Executive Board India Pvt Ltd 6th Floor  Tower B  DLF Building  No.10  DLF Cyber City Gurgaon Haryana 122002', 205, 38, '', '05-01-2018', 'Convergys India Services is a wholly owned subsidiary of $2.8 Billion Convergys Corporation and has been operational in India since 2001. Convergys Corporation is a global leader in providing customer care, human resources and billing services. We combine specialized knowledge and expertise with solid execution to deliver outsourced solutions, consulting services and software support. Clients in more than 70 countries speaking nearly 35 languages depend on us to manage the increasing complexity and cost of caring for customers and employees. We serve the world\'s leading companies in many industries including: Communications  Financial services  Technology  Consumer products Key achievements include: Most Admired Companies  Fortune for seven straight years, 2001 2007  Lifetime Achievement Award  Customer Inter@ction Solutions, May 2006  Gold MVP Quality Award winner for six consecutive years   Customer Inter@ction Solutions, May 2000 2005  \"Best Overall Company\" Excellence Award   Telestrategies Billing World  Billing and OSS World , 2006 Convergys employs more than 74,000 people in our contact centers, data centers and offices in the United States, Canada, Latin America, Europe, the Middle East and Asia In India, Convergys India Services delivers outstanding services to our global clients from our seven state of art contact centers located in Gurgaon, Mumbai, Pune and Bangalore.', '', '', 38, 0, '2023-03-01 09:08:00'),
(1922, 'Mr Shaurav Sen', 'svenkatiyer@exeutiveboard.com', '0124 4796000 or  or 0124 4796001', 'Corporate Insight', 'Corporate Insight B 123  Chittranjan Park New Delhi Delhi 110019', 205, 38, '', '05-01-2018', 'Convergys Information Management India  Pvt  Ltd is a 100 percent subsidiary of Convergys IMG and has its operations at Hi Tech City in Hyderabad. It is engaged in product development and support maintenance and implementation efforts of Convergys products throughout the world. Convergys Corporation  NYSE:CVG , a member of the S&P 500 and Forbes\' Platinum 400, provides award winning billing and customer care products and services to leading companies in telecommunications, cable and broadband, technology, financial services and next generation services across 30 countries. Convergys Information Management Group  IMG  provides consulting services, licenses its billing and customer care software, and processes more than 45 million bills a month for customers like Sprint PCS and AT&T. Convergys Customer Management Group is the 1 provider of tele services, handling calls for such clients as American Express and Microsoft, in the areas of customer service, technical support, and tele marketing. The company was spun off from Cincinnati Bell in 1998.', '', '', 38, 0, '2023-03-02 09:08:00'),
