(1926, 'Ms Smita Bhargava', 'corprisk@vsnl.com', '011 26537358 or  or 011 26537359', 'Corpus Software Pvt Ltd', 'Corpus Software Pvt Ltd Oxford House  5th Floor   # 15  Rustum Bagh Road  off Airport Road Bangalore Karnataka 560017', 205, 38, '', '05-01-2018', 'Cordiant Technologies provides outsourced product development and testing services in the eBusiness space to Independent Software Vendors worldwide. We run dedicated product competency centers as virtual extensions of a number of world class software product companies and ISVs, significantly reducing their costs and time to market. Cordiant testing services provide software QA, testing and consulting services to help optimize software application quality, performance and availability, while managing costs and risks for our clients and partners worldwide.', '', '', 38, 0, '2023-03-06 09:08:00'),
