(1928, 'V.K.Amrutlal', 'info@corrocare.com', '79 25841705 or 9824022539 or 79  25842233', 'Corrpro Corposion Control India  P  Ltd.', 'Corrpro Corposion Control India  P  Ltd. E 110  Crystal Plaza  New Link Road  Andheri  W   Mumbai Mumbai Maharashtra 400053', 205, 38, '', '05-01-2018', 'Cordys is a global software company that develops inventive collaborative solutions to deliver superior levels of agility, efficiency and responsiveness to companies and their networks. We serve networked organizations that want to achieve and sustain an improved level of business performance, at acceptable costs and at their own pace. We help our clients to capitalize on new opportunities such as enhanced responsiveness to customer demand, better time to market and more efficiency in the business chain.', '', '', 38, 0, '2023-03-08 09:08:00'),
(1929, 'Anand Vasant Nadkarni', 'corrpro.india@mtnl.net.in', '26733421   26732965   26732966 or  or 26733420', 'Corrpro Corrosion Control India Pvt. Ltd', 'Corrpro Corrosion Control India Pvt. Ltd E 110  Crystal Plaza New Link Road  Andheri  W   Mumbai Mumbai Maharashtra 400053', 205, 38, '', '05-01-2018', 'CoreBPO is a leading provider of high value business process outsourcing solutions to global clients. Headquartered in London, we provide consulting services in the field of offshore outsourcing, coupled with cost effective service delivery from our state of the art facilities in Gurgaon, a satellite town of New Delhi, India. CoreBPO is focused on leveraging India\'s advantage as the world\'s premier location for high quality and cost effective offshore services to bring a whole host of outsourcing solutions to international clients. Our range of services encompasses both voice based services such as customer service, telemarketing and collections as well as business process outsourcing services like finance/accounts outsourcing and transaction processing. At CoreBPO we possess an in depth understanding of business processes. Our team of consultants have travelled extensively around the world and have the experience of evaluating various successful business models and industry best practices. This is further augmented by our proprietary Process Migration methodology which can be customised to suit the needs of our clients. Outsourcing your business processes to CoreBPO can potentially bring you cost savings to the tune of 40 60%. We do this by deploying qualified staff at our offshore delivery facilities, thereby easing your overheads and eliminating costs related to capital equipment, hiring, training, payroll taxes, HR benefits and staff turnover. Furthermore, allowing us to shoulder the burden of managing your call centre and/or back office operations will enable you to focus your time and attention towards your core business. At the same time, we will deliver a number of other benefits that are inherent in outsourcing, namely:   Higher Quality Standards through Continuous Process Improvement   Flexibility in deploying new technologies   Scalability', '', '', 38, 0, '2023-03-09 09:08:00'),
